description:
Jake's senior year of high school is shaping up pretty well, until his guidance counselor takes him aside to put him in a special program. &quot;You're on a Pass/Fail basis now. If you pass enough tests you'll graduate with honors and I'll shake your hand. If you fail three tests, I'll personally take you behind the gymnasium and put a bullet in your head.&quot;

Now Jake's navigating a crazy maze of diabolic puzzles and impossible moral choices. And he's already failed his first test..

